class Pages extends React.Component {
    render() {
        return (
            <>
                <li className='BannerBot'>
                    <ul>
                        <button onClick={() => {console.log("hello")}}></button>
                    </ul>
                    <ul>
                        <button onClick={() => {console.log("hello")}}></button>
                    </ul>
                    <ul>
                        <button onClick={() => {console.log("hello")}}></button>
                    </ul>
                    <ul>
                        <button onClick={() => {console.log("hello")}}></button>
                    </ul>
                </li>
            </>
        )
    }
}

class Banner extends React.Component {
    render() {
        return (
            <div style={{Display: "Inline"}}>
                <div className='BannerTopLeft' style={{Display: "Inline"}}>

                </div>
                <div style={{Display: "Inline"}}>
                    <div className='BannerTopRight'>
                        <p className="name">Hello World</p>
                    </div>
                    <Pages/>
                </div>
            </div>
        )
    }
}

export {Banner}
